import React from "react";
import Info from "../Info/Info";
import ImageSlider from "../ImageSlider/ImageSlide.jsx";
import { Grid, Box } from "@mui/material/";

import "./login.css";

const Login = () => {
  return (
    <>
      <Box sx={{ flexGrow: 1 }}>
        <Grid
          container
          spacing={0.5}
          direction="row"
          justifyContent="center"
          alignItems="stretch"
        >
          <Grid item xs={2} md={8}>
            <Info />
          </Grid>
          <Grid item xs={6} md={8}>
            <ImageSlider />
          </Grid>
        </Grid>
      </Box>
    </>
  );
};

export default Login;
